import React from 'react';
import './Footer.css';
import footer_logo from '../Assets/logo_big.png';

const Footer = () => {
  return (
    <div className='footer'>
        <div className="footer-logo">
            <img src={footer_logo} alt="" />
            <p>StyleHaven</p>
        </div>
        <ul className="footer-links">
            <li></li>
            <li></li>
            <li></li>
            <li></li>
        </ul>
    </div>
  )
}

export default Footer
